import Home from './Home.js';
import Footer from './Footer.js';
import React from 'react';
import Cadastro from './Cadastro.js';
import {BrowserRouter as Router, Switch, link, Route} from 'react-router-dom'


function App(props){
  return (
    <div>
      <Router>
<Header />

<div>
    <Switch>
      <Route path="/Cadastro">   
      <Cadastro />   
     </Route>

     <Route path="/Home">
      <Home />
      </Route> 

   <Route path="/Home">
      <Home />
      </Route> 
     </Switch>

  </div>
<Footer />


</Router>
</div>


  );
};

export default App;
